		var draw_arrow = function(context, src_x, src_y, dst_x, dst_y)
		{
			//console.log(src_x + " " + src_y + " " + dst_x + " " + dst_y);
			var head_length = 20;
			var angle = Math.atan2(dst_y - src_y, dst_x - src_x);
			
			// Arrow line
			context.beginPath();
			context.lineWidth = 5;
			context.moveTo(src_x, src_y);
			context.lineTo(dst_x, dst_y);
			context.stroke();
		
		    var angle;
		    var x;
		    var y;
		    var r = 10;
		
		    context.beginPath();
		
		    angle = Math.atan2(dst_y-src_y,dst_x-src_x)
		    x = r*Math.cos(angle) + dst_x;
		    y = r*Math.sin(angle) + dst_y;
		
		    context.moveTo(x, y);
		
		    angle += (1/3)*(2*Math.PI)
		    x = r*Math.cos(angle) + dst_x;
		    y = r*Math.sin(angle) + dst_y;
		
		    context.lineTo(x, y);
		
		    angle += (1/3)*(2*Math.PI)
		    x = r*Math.cos(angle) + dst_x;
		    y = r*Math.sin(angle) + dst_y;
		
		    context.lineTo(x, y);
		
		    context.closePath();
		
		    context.fill();
    		
    		
		};
		
		var event_coords = function (e)
		{
			var input = e;
			if (typeof(input.clientX) === "undefined") {
				input = e.changedTouches[0];
			}
			return {x: input.pageX, y: input.pageY};	
		};
		
		var one_time_event = function(target, event_type, listener)
		{
			target.addEventListener(event_type, (e) => {
				target.removeEventListener(event_type, arguments.callee);
				return listener(e);	
			});
		};
		
		var Canvas = function(parent, index, background_path, name, traces)
		{	
			this.index = index;
			this.traces = traces;
			this.image = new Image();
			this.image.src = background_path;
			this.name = name;
			
			// Create canvas element
			var canvas = document.createElement('canvas');
			canvas.setAttribute('width', '200px');
			canvas.setAttribute('height', '200px');
			parent.appendChild(canvas);
			this.context = canvas.getContext('2d');
			this.rect = canvas.getBoundingClientRect();
			
			// Add listeners
			canvas.addEventListener('touchstart', (e) => {
				e.preventDefault();
				return this.start(e);
			});
			canvas.addEventListener('mousedown', (e) => {
				e.preventDefault();
				return this.start(e);
			});

			// Initial Draw
			this.context.drawImage(this.image, 0, 0);
			this.context.font = "15px serif";
			this.context.fillText(this.name, 5, 195);
		};
		
		Canvas.prototype.start = function(e)
		{
			var coords = event_coords(e);
			var src_x = coords.x - this.rect.left;
			var src_y = coords.y - this.rect.top;
			
			// Create a new move closure	
			var mouse_move = this.move(src_x, src_y);
				
			// Create move listeners
			e.target.addEventListener('mousemove', mouse_move);
			e.target.addEventListener('touchmove', mouse_move);
				
			// Create mouse up listeners
			var mouse_up = (e) => {
				e.preventDefault();
				e.target.removeEventListener('mousemove', mouse_move);
				e.target.removeEventListener('touchmove', mouse_move);	
			};
			one_time_event(e.target, 'touchend', mouse_up);
			one_time_event(e.target, 'mouseup', mouse_up);
		};
		
		Canvas.prototype.move = function(src_x, src_y)
		{
			// Create closure
			return (e) =>
			{
				e.preventDefault();
				var coords = event_coords(e);
				var dst_x = coords.x - this.rect.left;
				var dst_y = coords.y - this.rect.top;
					
				this.context.clearRect(0,0,300,300);
				this.context.drawImage(this.image, 0, 0);

				this.context.beginPath();
				this.context.lineWidth = 5;
				draw_arrow(this.context, src_x, src_y, dst_x, dst_y);
				this.context.stroke();

				// Draw name
				this.context.font = "15px serif";
				this.context.fillText(this.name, 5, 195);
				
				// Update trace here
				for (var i = 0; i < this.traces.length; i++)
					this.traces[i].update(this.index, src_x, src_y, dst_x, dst_y);
			};
		};
		
		var Trace = function(parent, angle, name)
		{
			this.indexes = [0, 0, 0, 0, 0, 0, 0];
			this.angle = angle;
			this.name = name;
			
			// Create a canvas
			var canvas = document.createElement('canvas');
			canvas.setAttribute('width', '402px');
			canvas.setAttribute('height', '202px');
			parent.appendChild(canvas);
			
			this.context = canvas.getContext('2d');
			
			this.redraw();
		}
		
		Trace.prototype.redraw = function()
		{
			
			this.context.clearRect(0, 0, 402, 202);

			// Draw name
			this.context.font = "24px serif";
			this.context.fillText(this.name, 5, 25);
			
			// Create Gridlines
			this.context.beginPath();
			this.context.lineWidth = 1;
			this.context.strokeStyle = "#cccccc";
			
			// Vertical minors
			for (var i = 0; i < 402; i += 20)
			{
				this.context.moveTo(i, 0);
				this.context.lineTo(i, 202);
			}
			
			// Horizontal Minors
			for (var i = 0; i < 202; i += 20)
			{
				this.context.moveTo(0, i);
				this.context.lineTo(402, i);
			}
			this.context.stroke();
			
			this.context.beginPath();
			this.context.lineWidth = 3;
			this.context.strokeStyle = "#cccccc";
			
			// Vertical Majors
			for (var i = 0; i < 402; i += 100)
			{
				this.context.moveTo(i, 0);
				this.context.lineTo(i, 202);
			}
			
			// Horizontal Majors
			for (var i = 0; i < 202; i += 100)
			{
				this.context.moveTo(0, i);
				this.context.lineTo(402, i);
			}
			this.context.stroke();
			
			// Intervals
			this.context.beginPath();
			this.context.lineWidth = 2;
			this.context.strokeStyle = "black";
			
			// -P
			this.context.moveTo(0, 140 - this.indexes[6]);
			this.context.lineTo(60, 140 - this.indexes[6]);
			
			// P-Q
			this.context.moveTo(100, 140 - this.indexes[6]);
			this.context.lineTo(135, 140 - this.indexes[6]);
			
			// S-T
			this.context.moveTo(180, 140 - this.indexes[4]);
			this.context.lineTo(220, 140 - this.indexes[4]);
			
			// T-
			this.context.moveTo(300, 140 - this.indexes[6]);
			this.context.lineTo(402, 140 - this.indexes[6]);
			
			this.context.stroke();
			
			// P-wave
			var p = new Path2D();
			p.moveTo(60, 140 - this.indexes[6]);
			p.arcTo(80, 140 - this.indexes[0], 100, 140 - this.indexes[6], 15);
			p.lineTo(100,140 - this.indexes[6]);
			this.context.stroke(p);
			
			// Q-Wave
			var q = new Path2D();
			q.moveTo(135,140 - this.indexes[6]);
			q.lineTo(140, 140 - this.indexes[1]);
			this.context.stroke(q);
			
			// R-wave
			var r = new Path2D();
			r.moveTo(140, 140 - this.indexes[1]);
			r.lineTo(160, 140 - this.indexes[2]);
			this.context.stroke(r);
			
			// S-wave
			var s = new Path2D();
			s.moveTo(160, 140 - this.indexes[2]);
			s.lineTo(170, 140 - this.indexes[3]);
			s.lineTo(180, 140 - this.indexes[4]);
			this.context.stroke(s);
			
			// T-wave
			var t = new Path2D();
			t.moveTo(220, 140 - this.indexes[4]);
			t.arcTo(260, 140 - this.indexes[5], 300, 140 - this.indexes[6], 15);
			t.lineTo(300,140 - this.indexes[6]);
			this.context.stroke(t);
		};
		
		Trace.prototype.update = function(index, src_x, src_y, dst_x, dst_y)
		{
			var x = dst_x - src_x;
			var y = dst_y - src_y;
			
			console.log("x: " + x + " y: " + y);
			
			var x2 = Math.cos(this.angle) * x - Math.sin(this.angle) * y;
			var y2 = Math.sin(this.angle) * x + Math.cos(this.angle) * y;
			
			console.log("x2: " + x2 + " y2: " + y2);
			
			this.indexes[index] = x2 * 0.8;
			this.redraw();
		};
		
		var ECG = function(parent, images)
		{
			// Create element for pqrst canvases
			var canvas_parent = document.createElement('div');
			parent.appendChild(canvas_parent);
			var ul = document.createElement('ul');
			canvas_parent.appendChild(ul);
			canvas_parent.appendChild(document.createElement('div')); // For clear
			
			// Create traces
			this.traces = [];
			var angles = [0, -Math.PI / 4, (-Math.PI / 4) * 3];
			var names = ["I", "II", "III"];
			for (var i = 0; i < 3; i++)
			{
				var trace_parent = document.createElement('div');
				trace_parent.className = 'trace';
				parent.appendChild(trace_parent);
				
				this.traces.push(new Trace(trace_parent, angles[i], names[i]));
			}
			
			// Create pqrst canvases
			this.canvases = [];
			var names = ["P", "Q", "R", "S", "S-T", "T", "T-Q"];
			for (var i = 0; i < 7; i++)
			{
				var li = document.createElement('li');
				ul.appendChild(li);
				this.canvases = new Canvas(li, i, images[i], names[i], this.traces);
			}
		}
		
		var main = function()
		{
			console.log("main");
			var div = document.getElementById('main');
			var ecg_healthy = new ECG(div, healthy);
			var ecg_transmural = new ECG(div, transmural);
			var ecg_subendocardial = new ECG(div, subendocardial);
		};
		
		document.addEventListener('DOMContentLoaded', main);
		
	</script>
